import React, { useState } from "react";
import styled from "styled-components";
import guestimg from "../../assets/guest.png"
import logo from "../../assets/logo.jpg";
import mock from "../../Mock"

export default function List() {

const ListContainer = styled.div`
  background-color: white;
  width: 27%;
`

const ProfileContainer = styled.div`
  background-color: skyblue;
  height: 15%;
  width: 100%;
`
const Profileimg = styled.img.attrs({
  src: `${guestimg}`
})`
width: 35%;
height: 100%;
background-color: white;
`

const Profilename = styled.text`
  color: black;
  position: absolute;
  font-size: 26px;
  padding-top: 15px;
  padding-left: 30px;
`

const Logo = styled.img.attrs({
  src: `${logo}`,
})`
position: absolute;
width: 10%;
height: 5%;
top: 0%;
right: 0%;
z-index: 1;
`
const Loginbtn = styled.button`
position: absolute;
width: 7%;
height: 5%;
top: 7.5%;
right: 1%;
border-radius: 1rem;
font-size: 27px;
justify-content: center;
text-align: center;
z-index: 2;
`

const Result_List = styled.div`
position: relative;
font-size: 20px;
background-color: cyan;
width: 90%;
height: auto;
left: 5%;
top: 3%;
z-index: 3;
border-color: black;
border: 3px;
`

  return (
    <ListContainer>

    <ProfileContainer>
      <Profileimg/>
      <Profilename>Guest님</Profilename>
      <Logo/>
      <Loginbtn>로그인</Loginbtn>
    </ProfileContainer>

    {mock.map(el => {
      return (

        <Result_List className="list" key={el.aca_id}>
          <div>{el.aca_name}</div>
          <div>{el.aca_grade}</div>
          <div>{el.location}</div>
          <div>{el.review}</div>
          <div>{el.subject}</div>
          <div>{el.score}</div>
        </Result_List>


      )
    })}

    </ListContainer>
  );
}
